import React from "react";

// reactstrap components
import { Card, CardHeader, CardBody, Row, Col } from "reactstrap";

function map() {
  return (
    <>
      <div className="content">
      <Row>
          <Col lg="8">
            <Card>
              <CardHeader>
                <h4 className="title">Coming soon!</h4>
              </CardHeader>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default map;
